import './Expenses.css';
import ExpenseItem from './ExpenseItem';
function Expenses(props) {
  let items = [];
  for (let i = 0; i < props.length; i++) {
    items.push(<ExpenseItem date={props[i].date} name={props[i].name} price={props[i].price} />)
  }
  return (
    <div>
      <ExpenseItem date="2021-03-12" name="New TV" price="799.49" />
      <ExpenseItem date="2021-03-28" name="Car Insurance" price="294.67" />
      <ExpenseItem date="2021-06-12" name="New Desk(Wooden)" price="450" />
    </div>
  )
}
export default Expenses;
